import React from 'react'
import { useState } from 'react'
import { FaRegTrashCan } from "react-icons/fa6";
const Face = () => {
  const [items,setItems]=useState(
    [
      {
        id:1,
        checked:false,
        name:"Reserve the Bus Ticket"
      },
      {
        id:1,
        checked:true,
        name:"Cancel the Bus Ticket"
      },
      {
        id:1,
        checked:true,
        name:"Date of the Bus"
      },
      {
        id:1,
        checked:true,
        name:"Timings Of the Bus"
      }
    ]
  )
  return (
    <div>
     <center> <p>To Do List</p>
      <ol>
        {
          items.map((item)=>(
            <li>
              <input
              type="checkbox"
              checked={item.checked}/>
              <label>{item.name}</label>
              <FaRegTrashCan 
              role="button"
              tabIndex={0}
              />
            </li>
          ))
        }
      </ol>
      </center>
    </div>
  )
}

export default Face
